import React from "react";
import CoffeCard from "./CoffeCard";
import { Grid } from "@material-ui/core";

const Content = () => {
  return (
    <Grid container spacing={4}>
      <Grid item xs={4}>
        <CoffeCard
          title={"title part"}
          subtitle={"sub part"}
          // avatarSrc={"Images/test.jpg"}
          avatarSrc={
            "https://shopping-phinf.pstatic.net/main_1536959/15369599180.20181002114630.jpg?type=f300"
          }
        />
      </Grid>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
    </Grid>
  );
};

export default Content;
